import React, { Component } from 'react';

class Cartcol extends Component {
    render() {
        return (
            <div class='row'>
                
                <div className="col-lg-2 col-sm-10">Produt</div>
                <div className="col-lg-2 col-sm-10">Product Name</div>
                <div className="col-lg-2 col-sm-10">Price</div>
                <div className="col-lg-2 col-sm-10">Quantity</div>
                <div className="col-lg-2 col-sm-10">Remove</div>
                <div className="col-lg-2 col-sm-10">Total</div>
            </div>
        );
    }
}

export default Cartcol;
